import React, { Component } from 'react';
import axios from 'axios';

const usageAPI = axios.create({
  baseURL: 'http://localhost:3000',
});

class Home extends Component{
  componentDidMount(){
    usageAPI.get().then(response => {console.log(response)});
  };

  render(){
    return(
      <div>
        <h3>Home View</h3>
      </div>
    )
  }
};

export default Home;
